import React from 'react';
import {makeStyles,Avatar, MenuList, MenuItem} from '@material-ui/core';
import theme from '../theme';

const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    small: {
        width: theme.spacing(3),
        height: theme.spacing(3),
    },
    medium: {
        width: theme.spacing(10),
        height: theme.spacing(10),
    },
    large: {
        width: theme.spacing(15),
        height: theme.spacing(15),
    },
    menuitem: {
        background: theme.primary,
    }
}));

function SideBar() {
    const classes = useStyles(theme);
    return (
      <div className={classes.root}>  
        <Avatar src="https://ca.slack-edge.com/T010MBR22KU-U019QV28AD8-b9e116383a90-512" className={classes.large}></Avatar>
        <MenuList>
            <MenuItem className={menuitem}>Computer Science Blog</MenuItem>
            <MenuItem>Data Science Blog</MenuItem>
            <MenuItem>Machine Learning Blog</MenuItem>
            <MenuItem>Other Blog</MenuItem>
        </MenuList>
      </div>
    );
  }

  export default SideBar;
